import React from "react";
import { createRoot } from "react-dom/client";
import App from "./app";
import "./app.css";

// Jika kamu pakai strict mode, aktifkan di bawah.
// StrictMode membantu menemukan potensi masalah saat development.
const rootElement = document.getElementById("root");
const root = createRoot(rootElement);

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
